import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Paper,
  Typography,
  TextField,
  Button,
  Grid,
  Box,
  IconButton,
  CircularProgress,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import AddIcon from '@mui/icons-material/Add';
import { createRecipe } from '../utils/api';

function RecipeGenerator() {
  const navigate = useNavigate();
  const [ingredients, setIngredients] = useState([{ name: '', amount: '', unit: '' }]);
  const [loading, setLoading] = useState(false);

  const handleIngredientChange = (index, field, value) => {
    const newIngredients = [...ingredients];
    newIngredients[index] = {
      ...newIngredients[index],
      [field]: value,
    };
    setIngredients(newIngredients);
  };

  const addIngredient = () => {
    setIngredients([...ingredients, { name: '', amount: '', unit: '' }]);
  };

  const removeIngredient = (index) => {
    setIngredients(ingredients.filter((_, i) => i !== index));
  };

  const generateRecipe = async () => {
    setLoading(true);
    try {
      // 材料リストを文字列に変換
      const ingredientsList = ingredients
        .map(ing => `${ing.name} ${ing.amount}${ing.unit}`)
        .join(', ');

      // レシピ生成のロジック（ここでは簡易的な例）
      const recipe = {
        title: `${ingredients[0].name}を使った簡単レシピ`,
        description: `${ingredientsList}を使った美味しいレシピです。`,
        instructions: `1. ${ingredients[0].name}を${ingredients[0].amount}${ingredients[0].unit}用意します。\n2. 他の材料も適切な量を準備します。\n3. 材料を混ぜ合わせます。\n4. お好みの調理方法で加熱します。`,
        difficulty: 'easy',
        cooking_time: 30,
        servings: 2,
        ingredients: ingredients.map(ing => ({
          name: ing.name,
          unit: ing.unit,
          calories: Math.floor(Math.random() * 100) // 仮のカロリー値
        }))
      };

      const createdRecipe = await createRecipe(recipe);
      navigate(`/recipes/${createdRecipe.id}`);
    } catch (error) {
      console.error('Error generating recipe:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Paper elevation={3} sx={{ p: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          材料からレシピを生成
        </Typography>

        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Typography variant="h6" gutterBottom>
              手持ちの材料を入力してください
            </Typography>
            {ingredients.map((ingredient, index) => (
              <Box key={index} sx={{ display: 'flex', gap: 2, mb: 2 }}>
                <TextField
                  label="材料名"
                  value={ingredient.name}
                  onChange={(e) => handleIngredientChange(index, 'name', e.target.value)}
                  required
                />
                <TextField
                  label="量"
                  value={ingredient.amount}
                  onChange={(e) => handleIngredientChange(index, 'amount', e.target.value)}
                  required
                />
                <TextField
                  label="単位"
                  value={ingredient.unit}
                  onChange={(e) => handleIngredientChange(index, 'unit', e.target.value)}
                  required
                />
                <IconButton
                  color="error"
                  onClick={() => removeIngredient(index)}
                  disabled={ingredients.length === 1}
                >
                  <DeleteIcon />
                </IconButton>
              </Box>
            ))}
            <Button
              startIcon={<AddIcon />}
              onClick={addIngredient}
              variant="outlined"
              sx={{ mt: 1 }}
            >
              材料を追加
            </Button>
          </Grid>

          <Grid item xs={12}>
            <Box sx={{ display: 'flex', gap: 2, justifyContent: 'flex-end' }}>
              <Button
                variant="outlined"
                onClick={() => navigate('/')}
              >
                キャンセル
              </Button>
              <Button
                variant="contained"
                color="primary"
                onClick={generateRecipe}
                disabled={loading || ingredients.some(ing => !ing.name || !ing.amount || !ing.unit)}
              >
                {loading ? <CircularProgress size={24} /> : 'レシピを生成'}
              </Button>
            </Box>
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
}

export default RecipeGenerator;
